        <td>綿６０％ ポリエステル４０％<br>
        <br>
      形態安定加工(お手入れ簡単)　<BR>
      防汚加工（汚れが落ちやすい） <BR>
      <BR>
      ～形態安定シャツの特長～ <BR>
      ●　洗濯を繰り返しても縮みが少なく、型くずれがほとんどありません <BR>
      ●　洗濯後の乾燥時間は従来品の約半分です <BR>
      ●　あまりシワが残らないので、アイロンは軽くあてる程度で充分です <BR>
      ●　長時間着用してもシワが気になりません </td>
    </tr>
    <tr>
        <td class="title">● お手入れ方法</td>
    </tr>
    <tr>
        <td>～形態安定シャツお洗濯メモ～ <BR>
      ◆水またはぬるま湯に、合成洗剤を溶かして弱流水で洗ってください。<BR>
      　シャツだけをネットに入れた洗濯をおすすめします。 <BR>
      ◆絞らずに釣り干か、タンブル・ドライ（乾燥機）が理想的です。 　<BR>
      脱水される場合は１５秒程度でお願いします。 <BR>
      ◆ノーアイロンで着用いただけますが、小じわが気になる時でも簡単なアイロン掛けできれいに仕上がります。 　<BR>
      アイロン掛けは中温（１４０℃～１６０℃）で行ってください。 　<BR>
      高温では縮み・変形が発生する恐れがありますのでご注意ください。</td>
    </tr>

    <tr>
        <td class="title">COOLBIZ【クールビズ】⇒【リピーター急増中◎】 どんどん【再入荷】中！形態安定カッターシャツＹシャツ simple is best 基本の白 ビジネスマンのマストアイテム「是非一度お試しください♪」
</td>
    </tr>
    <tr>
        <td>ビジネス 用品 メンズ ファッション スーツ に 形態安定 ワイシャツ メンズ 紳士服 ドレスシャツ ファッション トレンド ブランド ワイシャツ 形状記憶 トールサイズ ビッグサイズ カッターシャツSALE（セール）バーゲンCOOLBIZ(クールビズ) WARMBIZ(ウォームビズ)で ノーネクタイ(ノータイ)もビジネスシーン（お仕事）はもちろんプレゼントにも リーズナブルでコストパフォーマンスオリジナルブランドシャツ新作商品から定番アイテム、 再入荷、セール商品までオールシーズン対応のハイクオリティーデザインYシャツ Yshirts わいしゃつ waisyatu 衣替え ころもがえ 新入学 入学式 入園式 新入社員 入社式 フレッシュマンの新生活応援します。冠婚葬祭 結婚式 お葬式 お通夜 2017年度平成29年就職活動 就活 とはモダン＆リッチな着こなしでハンサム男を演出！
      店長もいつもスーツにノーネクタイでシーンに合わせてシャツを着用♪仕事着 小さいサイズ・メンズ大きいサイズ・メンズeco【デキる男のビジネススタイルをCHECK！】
      2017年 新作 登場 セール スーツ との コーディネイト の マスト アイテム 楽天市場 SAHARA(Yシャツ サハラ)ブロード無地 スノーホワイト regular
      collar shirts レビュー 書いてね 彼シャツ セクシー ロング スリーブ ホワイト シャツ long sleeve White shirt   フレッシャーズ リクルートそして白が大好きな あなたへ
      ブラックフォーマル 礼服 20代 ファッション 30代 ファッション 40代 ファッション 50代 ファッション 60代 ファッション 70代 ファッション シニアファッション 続々再入荷中！着心地のいい安心のワイシャツ （楽天/通販/仕事/面接/結婚式/葬式）<BR>
      ■クールビズとは？ 温室効果ガス削減のために、夏のエアコンの温度設定を28℃に。 そんなオフィスで快適に過ごすため、平成17年夏にスタートしたのが「COOL BIZ（クールビズ）」です。 スーパークールビズは、素材からデザイン、コーディネートまで様々な提案がなされています。 今では夏の オフィス の風物詩として、すっかり私たちの ライフスタイル に定着し様々な実践が展開されています。メンズ ファッション スーツ ワイシャツ 長袖 形態安定 白 無地 レギュラーカラーシャツ ホワイト ドレスシャツ ポイント 消化 男性 その他 無いサイズはお問い合わせ下さい。父の日の定番。 形態安定加工でお洗濯は楽々。ネット洗いがおススメ。アイロンは軽く当てる程度でＯＫ。シワになりにくい仕様のノンアイロン。アイロン不要ですがあてた方が綺麗で清潔感があります。防汚加工で黄ばみになりにくい。衿型は定番のレギュラーカラー襟。サイズ種類寸法が豊富なのでジャストサイズを選べます。値段もお手ごろおすすめ価格。大阪より発送します。</td>
